  true,\n\t\"url\": null,\n\t\"notes\": \"OASIS is a flight service automation system
  operational at the 17 Flight Service Stations in Alaska since 2007 and is owned
  and supported by an FAA contractor.  FAA Air Traffic Control Specialists operate
  OASIS and site level maintenance is performed by FAA Technical Operations personnel.
  OASIS provides integrated textual and weather graphicsproducts, flight plan processing,
  emergency services, law enforcement, flight planning and regulatory information
  and other services as defined in FAA Order 7110.10.  A technical refresh was completed
  in May 2012. The contract period of performance ends in December 31, 2014.\",\n\t\"license_title\":
